<html>
<style>
    @page {
        size: a5 portrait;
        padding: 0;
        margin: 0;

        @frame background_image { /* Another static Frame */
            -pdf-frame-content: background_image;
            left: 10pt; top: 10pt;
        }

        @frame name { /* Another static Frame */
            -pdf-frame-content: name;
            left: 60pt; top: 310pt; width: 160pt;
        }
        @frame phone_number { /* Another static Frame */
            -pdf-frame-content: phone_number;
            right: 85pt; top: 310pt; width: 100pt;
        }
        @frame paroisse { /* Another static Frame */
            -pdf-frame-content: paroisse;
            right: 112pt; top: 350pt; width: 100pt;
        }
        @frame diocese { /* Another static Frame */
            -pdf-frame-content: diocese;
            left: 105pt; top: 350pt; width: 100pt;
        }
        @frame qrcode { /* Another static Frame */
            -pdf-frame-content: qrcode;
            left: 145pt; top: 125pt; width: 300pt;
        }
        @frame person_contacter_phone { /* Another static Frame */
            -pdf-frame-content: person_contacter_phone;
            left: 160pt; top: 395pt; width: 95pt;
        }
    }
    .fond {
        height: 1080px;
    }
    #name {
        color: #fff;
        font-size: 1.5rem;
        background-color: #e96a25;
        margin: 0px;
        padding: 0px;
        line-height: 20px;
        font-weight: bold;
    }
    #phone_number {
        color: #fff;
        font-size: 2rem;
        background-color: #e96a25;
        margin: 0px;
        padding: 0px;
        line-height: 20px;
        font-weight: bold;
        text-align: right;
    }
    #paroisse {
        color: #fff;
        font-size: 1.5rem;
        background-color: #e96a25;
        line-height: 20px;
        margin: 0px;
        padding: 0px;
        font-weight: bold;
        text-align: right;
    }
    #qrcode img {
        width: 160px;
    }
    #diocese {
        color: #fff;
        font-size: 1.5rem;
        line-height: 20px;
        background-color: #e96a25;
        margin: 0px;
        padding: 0px;
        font-weight: bold;
    }
    #person_contacter_phone {
        color: #fff;
        font-size: 2rem;
        background-color: #e96a25;
        text-align: center;
        margin: 0px;
        padding: 0px;
        line-height: 20px;
        font-weight: bold;
    }
</style>

<body>

    <!-- Content for Static Frame 'qrcode' -->
    <div id="qrcode">
        <img src="data:image/png;base64,{{ qrcode | safe }}">
    </div>

    <div id="name">
        {{name}}
    </div>

    <div id="phone_number">
        {{part.phone_number}}
    </div>

    <div id="paroisse">
        {{part.paroisse}}
    </div>

    <div id="diocese">
        {{diocese}}
    </div>

    <div id="person_contacter_phone">
        {{part.person_contacter_phone}}
    </div>
